import React from "react";
import { Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./pages/HomePage";
import NewsPage from "./pages/NewsPage";
import NewsPageDetail from "./pages/NewsPageDetail";
import NotFoundPage from "./pages/NotFoundPage";
import GalleryPage from "./pages/GalleryPage";
import GalleryPageDetail from "./pages/GalleryPageDetail";
import ContactsPage from "./pages/ContacsPage";
import { RoutesList } from "./utils/constants";

function App() {
  return (
    <>
      <Header />
      <Routes>
        {RoutesList.map((item) => (
          <Route path={item.path} element={item.element}></Route>
        ))}
      </Routes>
      <Footer />
    </>
  );
}

export default App;
